import React from 'react';
import ReactDOM from 'react-dom';
import 'bootstrap/dist/css/bootstrap.min.css';


class Game extends React.Component{
    constructor(props){
        super(props);
        this.state={
            value: 'name',
            name : ''
        }
    }

    render(){
        return(
            <div>
                <h1>
                    {this.state.value}
                </h1>
            </div>
        )
    }
}

export default Game;
